/**
 * **valuesOf**(obj) -> readonly values[]
 *
 * Runtime utility to convert an object into a tuple of
 * values while preserving as much type information as
 * possible.
 */
export const valuesOf = (obj) => {
    const values = [];
    for (const k of Object.keys(obj)) {
        values.push(obj[k]);
    }
    return values;
};
